CREATE DATABASE IF NOT EXISTS bbebig;

DROP TABLE IF EXISTS friend;
DROP TABLE IF EXISTS member;

use bbebig;

CREATE TABLE member (
    id BIGINT AUTO_INCREMENT PRIMARY KEY,
    name VARCHAR(255) NOT NULL,
    email VARCHAR(255) UNIQUE KEY NOT NULL,
    password VARCHAR(255) NOT NULL,
    profile_img_url VARCHAR(255),
    nickname VARCHAR(255),
    custom_presence_status ENUM('ONLINE', 'OFFLINE', 'NOT_DISTURB', 'INVISIBLE'),
    created_at DATETIME DEFAULT CURRENT_TIMESTAMP,
    updated_at DATETIME DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
    birth_date DATETIME DEFAULT CURRENT_TIMESTAMP,
    last_access_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP
);

CREATE TABLE friend (
    id BIGINT AUTO_INCREMENT PRIMARY KEY, 
    from_member_id BIGINT,
    to_member_id BIGINT,
    status ENUM('ONLINE', 'OFFLINE', 'NOT_DISTURB', 'INVISIBLE'),
    server_list JSON,
    created_at TIMESTAMP,
    updated_at TIMESTAMP,
    FOREIGN KEY (from_member_id) REFERENCES member(id) ON DELETE CASCADE ON UPDATE CASCADE,
    FOREIGN KEY (to_member_id) REFERENCES member(id) ON DELETE CASCADE ON UPDATE CASCADE
);




SELECT * FROM member LIMIT 200;
